window.bookSummaryJSON = "<p>Not Quite the Fairy Tale is a series of paranormal romances made for a mature audience. Expect adult language and naughty stuff. Each audiobook is a stand-alone.</p> <p>The rules are simple: Humans from Enom are allowed to cross the forest, Jereena are killed on sight. Double standard, but as Jereenan had taken their land, not many Wilderlings have questioned it. </p> <p>Lana, an enforcer sworn to obey the alpha, doesn't like it, but never has she considered saying or doing anything about it until now. </p> <p>Then things become complicated when the prince of Ennom comes through with a battalion of Jereenan soldiers....</p>"; 
